import React from 'react';
import { withRouter } from 'react-router-dom';

const Hello = () => {
  const history = withRouter();
  const handleClick = () => history.push('/admin');

  return (
    <button type="button" onClick={handleClick}>
      Goodbye
    </button>
  );
};

export default Hello;
